import React from "react";
import { BrowserRouter,Route,Routes} from "react-router-dom";
import principalPage from '../pages/Principal'

function Router() {
    return (
      <BrowserRouter>
        <Routes>
          <Route exact path="/" component={<principalPage/>}/>
        </Routes>
      </BrowserRouter>
    );
  }

  export default Router;
